    setPlanData(response.data);
    console.log(response)

    return (
        <div>
        
                <div>
                    <h1>Available plan 1</h1>
                    <div>
                        {planData}
                    </div>

                </div>
         


            <button>Subscribe on plans</button>
            
        </div>
      

    );

};


export default SubscriptionPage;
